import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './styles/main.css';

// Polyfill for environment reads from some packages — only defines if missing.
if (typeof process === 'undefined') {
  // minimal safe polyfill for browser runtime
  // keep env empty — CRA uses REACT_APP_* and webpack will replace them at build time
  window.process = { env: {} };
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
